import React from "react";
import "../../Styles/Shared/PayingSimple.scss";

function PayingSimple({ img, title, paragraf }) {
  return (
    <div className='payingSimple'>
      <div className='payImg'>
        <img src={img} alt='' />
      </div>
      <div className='payTitle'>
        <h3>{title}</h3>
        <p>{paragraf}</p>
      </div>
    </div>
  );
}

export default PayingSimple;
